import React from "react";
import {
  IonBackButton,
  IonButtons,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

import MultiForm from "../../components/MultiForm/MultiForm";
import { useParams } from "react-router";

interface Agent {
  complexName: string;
  contractId: string;
  name: string;
  surname: string;
  id: string;
  cellNum: string;
  street1: string;
  street2: string;
  city: string;
  province: string;
  postalCode: string;
  password: string;
}

const agent: Agent ={
      complexName: "",
      contractId: "",
      name: "",
      surname: "",
      id: "",
      cellNum: "",
      street1: "",
      street2: "",
      city: "",
      province: "",
      postalCode: "",
      password: "",
}

const AddAgent: React.FC = () => {
  const {name, title} = useParams<{name: string, title: "agent" | "complex" | "package" | "promotion" }>();
  const backUrl = "/page/";
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton defaultHref={backUrl.concat(name).concat("/").concat(title)} />
          </IonButtons>
          <IonTitle>Add {name}</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <MultiForm buttonName="Add" type={title} isDisabled={false} content={agent }/>
      </IonContent>
    </IonPage>
  );
};

export default AddAgent;
